import React from 'react'
import N3 from './Nivel3'

function n2 (props) { 
  return (
    <div>
      <h2>Nivel2 {props.nomes[1]}</h2>
     <button onClick={props.funcRemove}>remove 1</button>
      <N3 nomes={props.nomes}/>
    </div>
  )
 }

export default n2;
